import React from "react";
import "./App.css";
import { ApolloProvider } from "@apollo/react-hooks";

import {
  ApolloClient,
  InMemoryCache,
  gql,
} from "@apollo/client";

const client = new ApolloClient({
  uri: "https://48p1r2roz4.sse.codesandbox.io",
  cache: new InMemoryCache(),
});

// const client = ...

client
  .query({
    query: gql`
      query {
        countries {
          name
          code
          native
          capital
          continent {
            name
          }
          languages {
            code
            name
            native
          }
          emoji
          emojiU
          states {
            name
          }
        }
      }
    `,
  })
  .then((result) => console.log(result));


const App = () => (
  <ApolloProvider client={client}>
    <div>

    </div>
  </ApolloProvider>
);
export default App;
